description:
Martial arts legend Jackie Chan and executive producer introduces a new generation of fans to the art of combat in the new action film Jackie Chan presents Wushu.

Arriving at a conservatory of elite martial arts, a group of young boys pledge allegiance to one another and form a gang.

A decade later at graduation, who unexpectedly cross paths with an evil martial arts master and foil his plan to secuestro. Ahora, they must put their combat skills to the test in order to defeat this enemy and save her brotherhood.

Jackie Chan presents Wushu is a fight movie elevation ... and even beautiful, highly recommended for fans of Sammo Hung and a good kung-fu actioner.


